import React from 'react'
import './info.scss'
import '../../node_modules/bootstrap/dist/css/bootstrap.min.css';
import { Button } from 'reactstrap';
import Typed from 'react-typed';

function Info() {
    return (
        <div className="container"> 
            <h1 className="hello">Hello.</h1> 
            <p className="name">This is Md. Rijyan Hossain</p>
            <p className="typed">& I am </p> 
            <Typed
                // typedRef={typedRef()}
                loop
                typeSpeed={80}
                backSpeed={60}
                strings={[" Computer Programmer", " Team Player", " JavaScript Developer", " React-Redux Developer", " NodeJS Developer", " Problem Solver"]}
                smartBackspace
                shuffle={false}
                backDelay={500}
                fadeOut={false}
                fadeOutDelay={1000}
                loopCount={0}
                showCursor
                cursorChar="|"
            />

            <img src="/static/images/me.jpg" alt="" align="left"/> 
            <Button className="cv" color="primary">
                Download CV 
            </Button>
        </div> 
    ) 
} 

export default Info
